import React, { Component } from "react";
import { withStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import { Grid } from "@material-ui/core";
import Typography from "@material-ui/core/Typography";
const styles = theme => ({
  card: {
    width: "100%"
  },
  title: {
    fontSize: 14
  },
  pos: {
    marginBottom: 12
  },
  root: {
    width: 800,
    marginTop: theme.spacing.unit * 3,
    overflowX: "auto"
  },
  table: {
    minWidth: 650
  },
  individualGrids: {}
});
function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}
const rows = [
  createData("Frozen yoghurt", 159, 6.0, 24, 4.0),
  createData("Ice cream sandwich", 237, 9.0, 37, 4.3),
  createData("Eclair", 262, 16.0, 24, 6.0),
  createData("Cupcake", 305, 3.7, 67, 4.3),
  createData("Gingerbread", 356, 16.0, 49, 3.9)
];
const carrierDetails = {
  labelCarrierCode: "Carrier Code",
  carrierCode: "B001", //this.props.carrierCode
  labelCarrierName: "Carrier Name",
  carrierName: "Batman", //this.props.carrierName
  labelLineOfBusiness: "Line Of Business",
  lineOfBusiness: "health,dental"
};

const businessDetailsHeader = [
  "Business Type",
  "",
  "",
  "",
  "",
  "",
  "",
  "Business States"
];
const businessDetailsValue = [
  { businessType: "On Exchange - Individual", states: "TX, LA, FL" },
  { businessType: "Off Exchange - Individual", states: "AL, MO, LT" },
  { businessType: "On Exchange - Group", states: "PT, FA, ML" },
  { businessType: "Off Exchange - Group", states: "TM, AM, FD" }
];

const bankDetailsHeader = [
  "State Code",
  "Bank Account Type",
  "Bank Name",
  "Bank Account Number",
  "Bank Number Code"
];
const bankDetailsValue = [
  {
    stateCode: "TX",
    bankAccountType: "Single Account",
    bankName: "Bank of USA",
    bankAccountNumber: "567890432",
    bankNumberCode: "345"
  },
  {
    stateCode: "FL",
    bankAccountType: "Joint Account",
    bankName: "Bank of Florida",
    bankAccountNumber: "667808764",
    bankNumberCode: "127"
  }
];

class ConfimatorPage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    const classes = this.props;
    return (
      <div>
        <Grid
          container
          spacing={24}
          direction="column"
          alignItems="center"
          justify="center"
        >
          {/* <Grid item xs={12} className={classes.individualGrids}>
            <Paper className={classes.root}>
              <Typography
                className={classes.title}
                color="textSecondary"
                gutterBottom
              >
                Word of the Day
              </Typography>
              <Typography variant="h5" component="h2">
                be nev lent
              </Typography>
              <Typography className={classes.pos} color="textSecondary">
                adjective
              </Typography>
              <Typography variant="body2" component="p">
                well meaning and kindly.
                <br />
                {'"a benevolent smile"'}
              </Typography>
            </Paper>
          </Grid> */}

          <Grid item xs={12} className={classes.individualGrids}>
            <Paper className={classes.root}>
              <Typography
                style={{ textAlign: "center" }}
                variant="h5"
                component="h2"
              >
                Carrier Details
              </Typography>

              <Table className={classes.table}>
                {/* <TableHead>
                  {carrierDetails.map(row => (
                    <TableCell component="th" scope="row">
                      {row.label}
                    </TableCell>
                  ))}
                </TableHead> */}
                <TableBody>
                  <TableRow key={carrierDetails.label}>
                    <TableCell
                      align="center"
                      style={{
                        color: "rgba(0, 0, 0, 0.54)",
                        fontSize: "0.75rem",
                        fontWeight: 500
                      }}
                    >
                      {carrierDetails.labelCarrierCode}
                    </TableCell>
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell align="center">
                      {carrierDetails.carrierCode}
                    </TableCell>
                  </TableRow>
                  <TableRow key={carrierDetails.label}>
                    <TableCell
                      style={{
                        color: "rgba(0, 0, 0, 0.54)",
                        fontSize: "0.75rem",
                        fontWeight: 500
                      }}
                      align="center"
                    >
                      {carrierDetails.labelCarrierName}
                    </TableCell>
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell align="center">
                      {carrierDetails.carrierName}
                    </TableCell>
                  </TableRow>
                  <TableRow key={carrierDetails.label}>
                    <TableCell
                      style={{
                        color: "rgba(0, 0, 0, 0.54)",
                        fontSize: "0.75rem",
                        fontWeight: 500
                      }}
                      align="center"
                    >
                      {carrierDetails.labelLineOfBusiness}
                    </TableCell>
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell />
                    <TableCell align="center">
                      {carrierDetails.lineOfBusiness}
                    </TableCell>
                  </TableRow>
                </TableBody>
              </Table>
            </Paper>
          </Grid>
          <Grid item xs={12} className={classes.individualGrids}>
            <Paper className={classes.root}>
              <Typography
                style={{ textAlign: "center" }}
                variant="h5"
                component="h2"
              >
                Carrier Business
              </Typography>
              <br />
              <Table className={classes.table}>
                <TableHead>
                  {businessDetailsHeader.map(row => (
                    <TableCell align="center" component="th" scope="row">
                      {row}
                    </TableCell>
                  ))}
                </TableHead>
                <TableBody>
                  {businessDetailsValue.map(row => (
                    <TableRow key={row.BusinessType}>
                      <TableCell align="center">{row.businessType}</TableCell>
                      <TableCell />
                      <TableCell />
                      <TableCell />
                      <TableCell />
                      <TableCell />
                      <TableCell />
                      <TableCell align="center">{row.states}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </Paper>
          </Grid>
          <Grid item xs={12} className={classes.individualGrids}>
            <Paper className={classes.root}>
              <Typography
                style={{ textAlign: "center" }}
                variant="h5"
                component="h2"
              >
                Carrier Bank Details
              </Typography>
              <br />
              <Table className={classes.table}>
                <TableHead>
                  {bankDetailsHeader.map(row => (
                    <TableCell align="center" component="th" scope="row">
                      {row}
                    </TableCell>
                  ))}
                </TableHead>
                <TableBody>
                  {bankDetailsValue.map(row => (
                    <TableRow key={row.bankAccountNumber}>
                      <TableCell align="center">{row.stateCode}</TableCell>
                      <TableCell align="center">
                        {row.bankAccountType}
                      </TableCell>
                      <TableCell align="center">{row.bankName}</TableCell>
                      <TableCell align="center">
                        {row.bankAccountNumber}
                      </TableCell>
                      <TableCell align="center">{row.bankNumberCode}</TableCell>
                    </TableRow>
                  ))}
                </TableBody>
              </Table>
            </Paper>
          </Grid>
        </Grid>
      </div>
    );
  }
}
export default withStyles(styles)(ConfimatorPage);
